import Button from "../../Button";

const Learn_Overall = ({ title, image, orderLink, light = false }) => {
  return (
    <section
      className={`padding grid lg:grid-cols-2 gap-5 ${
        light && "text-slate-50"
      }`}
    ></section>
  );
};

export default Learn_Overall;
